import React from 'react';
import '../styles/Home.css';

const Home = () => {
  return (
    <section id="home">
      <h1>Welcome to My Portfolio</h1>
      <h2>Building Innovative Solutions with Passion and Precision</h2>
      <p>
       <br></br> I'm Mohammed Ikram Ashrafi, a Full-Stack Developer & DevOps Engineer with a passion for delivering high-quality solutions that exceed expectations.
      </p>
    </section>
  );
};

export default Home;
